Viale Jenner, a pochi passi dalla fermata del passante ferroviario "Lancetti" e dalla fermata della metropolitana - linea gialla "Maciachini", proponiamo in vendita splendido bilocale di 60 mq posto all'ultimo piano di uno stabile signorile, in fase di completa ristrutturazione. L'immobile è così composto: ingresso, soggiorno con cucina e balcone da cui si gode una vista panoramica sulla città, disimpegno, camera e bagno.La sapiente e totale ristrutturazione doterà l'immobile dei più moderni impianti:Cappotto termico;
Infissi in PVC triplo vetro;
Tapparelle avvolgibili motorizzate;
Impianto di domotica;
Impianto fotovoltaico realizzato con moduli ad alta velocità per la produzione di energia elettrica (potenza di picco non inferiore a 10 kWp);
Impianto di riscaldamento a pannelli radianti

